	<div class="content">
											AlphaPet Superpremium полнорационный корм для собак и кошек, максимально соответствующий их нормам питания.<br>
 <br>
 Тщательно подобранный ингредиентный состав и высокое содержание свежего мяса подойдет даже для самых привередливых питомцев.<br>
 <br>
<ul class="article-list">
	<li>30% свежего мяса.</li>
	<li>Доля мясного белка: 79%-86%ю</li>
	<li>Источники углеводов: гипоаллергенный рис, овес и ячмень с низким гликемическим индексом.</li>
	<li>Уникальный комплекс AlphaPetBIO.</li>
	<li>Натуральные мясные продукты: индейка, цыпленок, ягненок, говядина, утка и др.</li>
	<li>Высококачественные мясные ингредиенты: индейка, цыпленок, ягненок, говядина, утка и др.</li>
	<li>Все ингредиенты выше качества HUMAN GRADE.</li>
	<li>Природные источники ОМЕГА-3 и ОМЕГА-6 – животный и рыбий жир, семена льна.</li>
	<li>Бережная технология производства, сохранение питательных веществ благодаря азотированию.</li>
	<li>Без ГМО, искусственных ароматизаторов, красителей</li>
	<li>Удобная упаковка с EASYLOCK, разнообразие фасовок</li>
</ul>
 <b><br>
 </b>
<h2>Ассортиментный ряд для кошек:</h2>
<b><br>
 </b><br>
 <img width="512" alt="cat.png" src="/upload/medialibrary/ac2/ojn8i0e8udxl47hxc3g1o9pzgg9fgqpt.png" height="288" title="cat.png"><br>
<h2>Ассортиментный для собак:</h2>
 <br>
 <img width="512" alt="dog.png" src="/upload/medialibrary/7ba/c90yhxzjb5b6ri5iln1308notb2y08h0.png" height="288" title="dog.png"><br>
 <br>
 Разберем один из составов кормов на примере AlphaPet&nbsp;Superpremium для кошек с уткой и индейкой <b>для взрослых стерилизованных </b><b>кошек и котов</b><b>:</b><br>
 <br>
 Свежее мясо 30% (утка, индейка, курица, свиные печень и сердце), дегидрированное мясо птицы 19% (курица, индейка), рис 15%, ячмень, овес, гидролизованная куриная печень, животный жир, желтый горошек, витаминноминеральная смесь, сушеная мякоть сахарной свеклы, пивные дрожжи, комплекс AlphaPetBIO&nbsp;(зеленогубый моллюск, календула, одуванчик, льняноесемя, цикорий, клюква, Юкка Шидигера, розмарин), рыбий жир, таурин, DLметионин, антиоксидант.<br>
 <br>
 И для собак AlphaPet&nbsp;Superpremium с индейкой и рисом<b> для собак мелких пород:</b><br>
 <br>
 Свежее мясо и рыба 30% (индейка, хамса, говяжьи субпродукты, курица), дегидрированное мясо птицы 19% (курица, индейка), рис 13%, Животный жир, ячмень, чечевица, яблоко, гидролизированная куриная печень, картофель, желтый горошек, сушеная мякоть сахарной свеклы, морковь, пивные дрожжи, Комплекс AlphaPetBIO&nbsp;(зеленогубый моллюск, одуванчик, льняное семя, розмарин, цикорий, томаты, Юкка Шидигера), рыбий жир, DL-метионин, антиоксидант.<br>
